create table CUSTOMER_ACCOUNT (
	customer_account_id BIGINT NOT NULL,
	account_num VARCHAR(20) NOT NULL UNIQUE,
	account_system VARCHAR(25) NOT NULL,
	account_status VARCHAR(25) NOT NULL,
	account_start_date TIMESTAMP NOT NULL,
	account_end_date TIMESTAMP NOT NULL,
	customer_id BIGINT NOT NULL,
	create_usr VARCHAR(50) NOT NULL,
	create_date TIMESTAMP,
	mod_usr VARCHAR(50),
	mod_date TIMESTAMP,
	PRIMARY KEY (customer_account_id)
);

